import React, {  useEffect, useState } from 'react'
import Header from '../../components/header'
import { useDebounce } from 'usehooks-ts'
import './index.scss'
import { useCommonComponents } from '../../providers/commonComponentsProvider'


const SelectSongs = () => {
    const [query, setQuery] = useState<string>('')
    const debouncedValue = useDebounce<string>(query, 500)
    const {showLoader,hideLoader} = useCommonComponents()
    const fetchSongs = (text:string) => {
        showLoader(null)
        console.log(text)
    }
    useEffect(() => {
        if(debouncedValue?.length){
            fetchSongs(debouncedValue)
        }
    },[debouncedValue])
    return (
        <>
            <Header pageName='Select songs' />
            <div className='songs-container container'>
                <input name='search' id='search' className='search-input' value={query} onChange={e => setQuery(e.target.value)} />
            </div>
        </>
    )
}

export default SelectSongs
